import React, { useState, useEffect } from 'react';
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import { AuthProvider, useAuth } from "./context/AuthContext";
import ProtectedRoute from "./components/ProtectedRoute";

// Auth Pages
import Login from "./pages/Login";
import Register from "./pages/Register";
import AdminUsers from "./pages/AdminUsers";
import Unauthorized from "./pages/Unauthorized";

// Original Application Components
import ContactForm from './components/ContactForm';
import ContactList from './components/ContactList';
import ExcelImport from './components/ExcelImport';
import RequirementForm from './components/RequirementForm';
import FollowUps from './components/FollowUps';
import QuickAddContact from './components/QuickAddContact';
import Dashboard from './components/Dashboard';

// Main Application Component (Your original app)
function MainApplication() {
  const { user, logout } = useAuth();
  const [activeTab, setActiveTab] = useState('dashboard');
  const [contacts, setContacts] = useState([]);
  const [requirements, setRequirements] = useState([]);

  const handleContactAdded = () => {
    // Refresh contacts when new contact is added
    if (activeTab === 'contacts' || activeTab === 'dashboard') {
      window.location.reload();
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header with User Account */}
      <header className="bg-white shadow-sm border-b">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center py-4">
            <h1 className="text-2xl font-bold text-gray-900">Contact & Job Tracker</h1>
            <div className="flex items-center space-x-4">
              <span className="text-sm text-gray-700">Welcome, {user?.name}</span>
              <span className="text-xs text-gray-500 bg-gray-100 px-2 py-1 rounded">{user?.role}</span>
              {(user?.role === 'admin' || user?.role === 'superadmin') && (
                <button
                  onClick={() => setActiveTab('admin')}
                  className="text-blue-600 hover:text-blue-800 text-sm"
                >
                  Manage Users
                </button>
              )}
              <button
                onClick={logout}
                className="bg-red-600 text-white px-3 py-1 rounded text-sm hover:bg-red-700"
              >
                Logout
              </button>
            </div>
          </div>
        </div>
      </header>

      {/* Navigation Tabs */}
      <nav className="bg-white border-b">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex space-x-8">
            {['dashboard', 'contacts', 'add-contact', 'requirements', 'import', 'followups'].map((tab) => (
              <button
                key={tab}
                onClick={() => setActiveTab(tab)}
                className={`py-3 px-1 border-b-2 font-medium text-sm ${
                  activeTab === tab
                    ? 'border-blue-500 text-blue-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                {tab.charAt(0).toUpperCase() + tab.slice(1).replace('-', ' ')}
              </button>
            ))}
            {(user?.role === 'admin' || user?.role === 'superadmin') && (
              <button
                onClick={() => setActiveTab('admin')}
                className={`py-3 px-1 border-b-2 font-medium text-sm ${
                  activeTab === 'admin'
                    ? 'border-blue-500 text-blue-600'
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                User Management
              </button>
            )}
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
        <div className="px-4 py-6 sm:px-0">
          {activeTab === 'dashboard' && <Dashboard />}
          {activeTab === 'contacts' && <ContactList />}
          {activeTab === 'add-contact' && <ContactForm onContactAdded={handleContactAdded} />}
          {activeTab === 'requirements' && <RequirementForm />}
          {activeTab === 'import' && <ExcelImport onContactAdded={handleContactAdded} />}
          {activeTab === 'followups' && <FollowUps />}
          {activeTab === 'admin' && (user?.role === 'admin' || user?.role === 'superadmin') && <AdminUsers />}
        </div>
      </main>
    </div>
  );
}

export default function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <Routes>
          {/* Public Routes */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/unauthorized" element={<Unauthorized />} />

          {/* Protected Route - Your Original Application */}
          <Route
            path="/*"
            element={
              <ProtectedRoute>
                <MainApplication />
              </ProtectedRoute>
            }
          />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}
